import Link from 'next/link';

const Navegacion = () => (

    <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="container">
            <Link href="/"><a className="navbar-brand">TodoBitcoin</a></Link>
        </div>
    </nav>
);

export default Navegacion;
